import React, { useState, useContext } from "react";
import MajorDataService from "../../services/MajorRequirements.js";
import MajorNames from "../../data/data.json";
import UserContext from "../../contexts/UserContext";
import "./index.scss";
import {
  CardContent,
  Card,
  Typography,
  Grid,
  Checkbox,
  CardHeader,
} from "@mui/material";
import { Masonry } from "@mui/lab";

const Semester = () => {
  const { courseList, semesterList } = useContext(UserContext);
  const flattenedSemesterList = [];
  semesterList.forEach((semester) => {
    semester.forEach((course) => {
      flattenedSemesterList.push(course);
    });
  });

  console.log(flattenedSemesterList);

  return (
    <div className="container semester">
      <div className="mui-grid">
        <>
            courseList.forEach()
        </>
      </div>
    </div>
  );
};

export default Semester;
